import React from "react";
import styled from "styled-components";

const ContainerContent = styled.div`
  padding: 20px 0;
  max-width: 860px;
  margin-left: auto;
  margin-right: auto;

  animation: fade-in 1.2s ease-out;
`;

const ContentItem = styled.div`
  p {
    line-height: 22px;
    font-size: 14px;
    text-align: justify;
  }
`;

const Content = ({ topics }) => {
  let item = document.getElementsByClassName("active");
  console.log(item);
  for (let topic of topics) {
    // console.log(topic.title);
  }

  return (
    <>
      <section>
        <ContainerContent>
          <ContentItem>
            {topics.map(({ ilustration, text }) => (
              <>
                <img className="img" src="../images/sleep.png" />
                <p></p>
              </>
            ))}
          </ContentItem>
        </ContainerContent>
      </section>
    </>
  );
};

export default Content;
